import React from "react";
import BackgroundImage from './back2.png';
import './style.css';
//import templates from other places
import Header from "./HTMLComponents/Header";
import SignUp from "./HTMLComponents/SignUp";
//import MainContent from "./HTMLComponents/MainContent";
//import Footer from "./HTMLComponents/Footer";

class App  extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      backgroundImage: BackgroundImage,
      database: []
    }
  }

  componentDidMount(){
    document.title ="Razzlers";
    this.fetchData();
  }

  fetchData(){
    const url = "http://localhost:3001/api/getData";
    fetch(url, {method: 'GET'})
    .then(response => {
      if(response.ok)
      {
        response.json().then(json => {
          // console.log(json[0].username + ": " + json[0].first_name + " " + json[0].last_name);
          console.log(json);
        })
      }
    })
    .then()
  }
  render(){
    const{backgroundImage, logo, database} = this.state;
    return (
      <div>
          <img src = {this.state.backgroundImage} id = "bg"/>
          <Header />
          <SignUp/>
          <div top= "300px">
            <p>
              <br/><br/><br/><br/><br/><br/><br/>

                <font color="white">
                  <u><b>Team Members:</b></u><br/>
                  Cody Alexander<br/>
                  Connor Wolanski<br/>
                  Yash Bhure<br/>
                  Rigoberto Canales Maldonado<br/>
                </font>
            </p>
            <p>
              <br/>
              <a href="https://docs.google.com/spreadsheets/d/1oB89hJ1GFzxqWqvS5EAoRzdsZX7hjpS6eOnHcdjmu2g/edit?usp=sharing" target="_blank">Click here for Log Sheet!</a>
              <br/>
              <a href="https://docs.google.com/document/d/1sDUOCYqBGxDh_UEdmFem4ufKH6Z9PKwI-xJBBrAMPlg/edit?usp=sharing" target="_blank">Click here for Software Requirement Specifications!</a>
              <br/>
            </p>
          </div>
      </div>
    );
  }
}
export default App;
